   min-height: 50vh; 
`;

function Home() {
  return (
    <Wrapper>
      <div classname="container">
        <h2>Welcome to Motez</h2>
        <h4>Get the best and latest products here </h4>
      </div>
    </Wrapper>
  );
}

export default Home;
